sys_variable_value.value:
(function execute(inputs, outputs) {
    var beginLessThanEnd = false;
    var currentIP = inputs.current_ip_address;
    var endingIP = inputs.ending_ip_address;

    var netUtils = new global.networkHelper();

    if(netUtils.ipStartLessThanEnd(currentIP, endingIP)){
        beginLessThanEnd = true;
    }

    outputs.begin_less_than_end = beginLessThanEnd;

})(inputs, outputs);

